import React from "react";

export default function FormattedTime(props) {
  let time = props.data.date - props.data.timezone;
  console.log(time);
  let currentTime = time.toLocaleTimeString("en-US", {
    hour: "2-digit",
    minute: "2-digit",
  });
  // return <div className='formattedTime'>{currentTime}</div>;
  return "hello from time";
}
